import React, { useState, useEffect } from 'react';
import Form from 'react-bootstrap/Form';
import { useParams, useNavigate } from "react-router-dom";
import Swal from 'sweetalert2'
import axios from 'axios'


const UpdateOrder = () => {
  const { displayOrderId } = useParams();
  const history = useNavigate();
  const [order, setOrder] = useState({
    displayOrderId: "",
    logisticName: "",
    awbNo: "",
  });

  const { logisticName, awbNo } = order;
  const onInputChange = e => {
    setOrder({ ...order, [e.target.name]: e.target.value });
  };

  const MySweetAlter = () => {
    Swal.fire({
      title: "Do you want to update the changes?",
      showDenyButton: true,
      showCancelButton: true,
      confirmButtonText: "update",
      denyButtonText: `Don't update`
    }).then((result) => {
      /* Read more about isConfirmed, isDenied below */
      if (result.isConfirmed) {
        Swal.fire("updated!", "", "success");
      } else if (result.isDenied) {
        Swal.fire("Changes are not saved", "", "info");
      }
    });
  }

  const onSubmit = async e => {
    e.preventDefault();
    await axios.put(`http://localhost:8080/updateorderdetails`, order);
    MySweetAlter();
    history("/");

  };

  const loadUser = async () => {
    const result = await axios.get(`http://localhost:8080/getcustomerorderbydisplayorderid/${displayOrderId}`);
    setOrder(result.data);
  };
  useEffect(() => {
    loadUser();
  }, []);

  return (
    <div >
      <div style={{ background: 'white', width: '500px', height: '450px', margin: '200px', borderRadius: '10px', boxShadow: ' rgba(0, 0, 0, 0.24) 0px 3px 8px' }} >
        <div style={{ height: '50px', background: '#1873CC' }}><h2>Edit Order</h2></div>
        <Form onSubmit={e => onSubmit(e)}>
          <div style={{ margin: "5px 30px 1px 30px" }}>

            <Form.Group className="mb-auto">
              <Form.Label>display OrderId</Form.Label>
              <Form.Control type="text" placeholder="Enter Your displayOrderId" name="displayOrderId" value={displayOrderId} onChange={e => onInputChange(e)} />
            </Form.Group>

            <Form.Group className="mb-auto">
              <Form.Label>logistic Name</Form.Label>
              <Form.Control type="text" placeholder="Enter Your logistic Name" name="logisticName" value={logisticName} onChange={e => onInputChange(e)} />
            </Form.Group>

            <Form.Group className="mb-auto">
              <Form.Label>logistic Name</Form.Label>
              <Form.Control type="text" className="form-control form-control-lg" placeholder="Enter Your awb No" name="awbNo" value={awbNo} onChange={e => onInputChange(e)} />
            </Form.Group>
          </div>
          <div>
            <button className="btn btn-warning btn-block">Update Order</button>
          </div>
        </Form>
      </div>
    </div>



  );
};

export default UpdateOrder;

